description.text:
To flatten a gear just add the argument 'flat = true' to the 'gear' module call and you will have a nice 2D gear ready for export :-).
gear(flat = true, [normal arguments, ...]);
TIP: See openscad example017.scad (File&gt;Examples in openscad) for a good example of a model, which has extra code to allow exporting for construction.
